    width: 300px;
    height: 100%;
    & > li {
        height: 10%;
        border-bottom: 1px solid #aaf;
        position: relative;
        &:hover {
            cursor: pointer;
            background-color: #77f;
            &::after {
                content: '';
                position: absolute;
                border-style: solid;
                border-width: 0 0 0 10px;
                border-color: #77f transparent;
                display: block;
                width: 0;
                z-index: 1;
                top: 5%;
                right: -1005px;
            }
        }
        &::after {
            content: '';
            position: absolute;
            border-style: solid;
            border-width: 20px 30px ;
            border-color: transparent #77f;
            display: block;
            width: 0;
            z-index: 1;
            top: 5%;
            right: -1005px;
        }
    }
`;

const AdminNav = () => {
    return (
        <NavContainer>
            <li></li>
            <li></li>
        </NavContainer>
    );
};

export default AdminNav;
